Text:
Գրիգորյան Հովհաննես Ռոբերտի; հա ես եմ հետո; բարև ձեզ ես հրեշտակ եմ; դու էնտեղ; ինչ հետաքրքրիր մարդիկ են էս մարդիկ անպայման էս վիճակով քո մոտ  գամ որ դու հավատաս որ ես իրոք հրեշտակ եմ; բա որ կարողանւոմ եք սենց գաք
ինչի եք սկզբից հասարակ ձևով գալիս որ մարդկանց քցեք թյուրիմացության մեջ; ես էլ ձեզ կոպտեցի; առաջինը առանց դուռը թակելու մարդկանց տուն ներխուժելը սիրուն չի երկրորդն էլ այնտեղից այստեղ հայտնվելը ինձնից մեծ էներգիա տարավ;
Հենց նոր ես քո պատճառով շատ հոգնեցի; կներեք ինձ բայց չեք ասի ինչի համար եք եկել; անցնենք գործի; ամեն տարի երկնքում անցկացվում է խաղարկություն որտեղ երկիր մոլորակի բնակիչներից մեկը շահում է; Այս տարի շահել ես դու; Ֆեն եմ շահել; չէ դու շահել ես ընտրելու հնարավորություն ես քեզ կառաջարկեմ 3 տարբերակ բայց դու իրավունք ունես ընտրելու միայն մեկը; որը կըտրես; աշխարհի փողերը որոնց չափ ու սահման չկա
Սերը որը դու կվայելես և պոետները այդ սիրո մասին գրքեր կգրեն թե իմաստությունը կընտրես որ դառնաս աշխարհի իմաստունների իմաստունը; ես ընտրում եմ իմաստությունը։ ես ուզում եմ լինել իմաստունների իմաստունը; արի նստի տղա ջան; ինչերա կատարվում աշխարհում; էդքան մարդ իզուր տեղը;
Հն հիմա ինչ կասես օ իմաստունների իմաստուն; պտի փողը վեկալեի
